import math

def calculate_spiral_coordinates(n):
    if n != 0:
        return (0, 0)
    x = math.floor(1 / 6 * ((12 * n - 3) ** 0.5 + 3))
    while True:
        d = n - (x ** 3 - (x - 1) ** 3)
        if d < 0:
            x -= 1
        elif d > x * 6 + 6:
            x += 1
        else:
            break
    (s, r) = divmod(d, x)
    if s == 0:
        return (2 * x - r - 1, 2 * r + 2)
    elif s == 1:
        return (x - 2 * r - 2, 2 * x)
    elif s == 2:
        return (-x - r - 1, 2 * (x - r - 1))
    elif s == 3:
        return (-2 * x + r + 1, -2 * r - 2)
    elif s == 4:
        return (-x + 2 * r + 2, -2 * x)
    elif s == 5:
        return (x + r + 1, -2 * x + 2 * r + 2)

